class DestinationSearch extends Component {

    state = { searchInput: "" };

    displayListOfsearchresults = (event) => {
        const inputValue = event.target.value;

        this.setState({ searchInput: inputValue });

    }

    render() {

        const { searchInput } = this.state;

        const filteredList = destinationsDetailsList.filter(eachItem => eachItem.name.toLowerCase().includes(searchInput.toLowerCase()));

        return (
            <div className="destination-bg">
                <h1 className="destination-heading">Destination Search</h1>
                <input type="search" placeholder="Search Input" className="destination-search-input"
                    value={searchInput} onChange={this.displayListOfsearchresults} />
                <div className="container">
                        <ul className="destination-list row d-flex justify-content-between">
                            {filteredList.map(eachPlace => (
                                <DestinationCard eachPlace={eachPlace} key={eachPlace.id} />
                            ))}
                        </ul>
                </div>
            </div>
        );
    }
}

export default DestinationSearch;

